title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o12778.m19 -> o12778.m30 -> o12778.m34 -> o12791.m24 -> o12778.m30
  o12791.m24 -> o12778.m30 -> o12778.m34 -> o12791.m24
  o12778.m34 -> o12791.m24 -> o12778.m30 -> o12778.m34
  o12778.m15 -> o12778.m30 -> o12778.m34 -> o12791.m24 -> o12778.m30
  o12778.m4 -> o12778.m30 -> o12778.m34 -> o12791.m24 -> o12778.m30
  o12778.m30 -> o12778.m34 -> o12791.m24 -> o12778.m30

features:
  - inheritance
  - overriding
  - method
  - polymorphism

